import React from "react";

function ListSection(props) {
  return (
    <div class="d-flex flex-column flex-md-row justify-content-between mb-4">
    <div class="flex-grow-1">
      <h3 class="mb-0">{props.listName}</h3>

    </div>
  </div>
  );
}

export default ListSection;
